w a Enter Form button on the encounters tab of the patient dashboard','719dd2a2-6d0a-4804-baab-527b0b94ff2d','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('formfilter.database_version','1.0-SNAPSHOT','DO NOT MODIFY.  Current database version number for the formfilter module.','4db8c004-4113-41d2-a0d7-b9fdc82026c1',NULL,NULL,NULL,NULL),('formfilter.mandatory','false','true/false whether or not the formfilter module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','fc7c2013-d098-45a5-aa8b-86d9da3c012f',NULL,NULL,NULL,NULL),('formfilter.started','true','DO NOT MODIFY. true/false whether or not the formfilter module has been started.  This is used to make sure modules that were running  prior to a restart are started again','55d8a9a3-247d-4bf0-9a19-41ece3faf162',NULL,NULL,NULL,NULL),('formFilter.useRoleInheritanceComparison','yes','Should we consider user role inheritance comparison ? (yes/no)','079d27f7-2d2f-4fa7-ad52-0fdd417a1251',NULL,NULL,NULL,NULL),('graph.color.absolute','rgb(20,20,20)','Color of the \'invalid\' section of numeric graphs on the patient dashboard.','6c931fd2-d8ae-424c-911d-72dbb5855fca',NULL,NULL,NULL,NULL),('graph.color.critical','rgb(200,0,0)','Color of the \'critical\' section of numeric graphs on the patient dashboard.','6a7bee06-7638-4ab7-ab40-6f92b9fbeb3f',NULL,NULL,NULL,NULL),('graph.color.normal','rgb(255,126,0)','Color of the \'normal\' section of numeric graphs on the patient dashboard.','7d88137c-c07b-440f-8946-4844469a83a7',NULL,NULL,NULL,NULL),('gzip.enabled','false','Set to \'true\' to turn on OpenMRS\'s gzip filter, and have the webapp compress data before sending it to any client that supports it. Generally use this if you are running Tomcat standalone. If you are running Tomcat behind Apache, then you\'d want to use Apache to do gzip compression.','54640d19-a149-42d8-bac7-e199ca9d828f','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('hl7_archive.dir','hl7_archives','The default name or absolute path for the folder where to write the hl7_in_archives.','6eaab485-ff6e-40b6-979b-6205ecfeb202',NULL,NULL,NULL,NULL),('hl7_processor.ignore_missing_patient_non_local','false','If true, hl7 messages for patients that are not found and are non-local will silently be dropped/ignored','648cf731-e6e3-49aa-97e7-acc8b00dbbfe','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('htmlformentry.database_version','1.2.0','DO NOT MODIFY.  Current database version number for the htmlformentry module.','0fc86b59-f196-417d-8be1-005251a75d29',NULL,NULL,NULL,NULL),('htmlformentry.dateFormat',NULL,'Always display dates in HTML Forms in this (Java) date format. E.g. \"dd/MMM/yyyy\" for 31/Jan/2012.','bdaa3061-0ba2-4f9b-9771-843c57d80cf8',NULL,NULL,NULL,NULL),('htmlformentry.mandatory','false','true/false whether or not the htmlformentry module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','0dc71439-96df-4ec5-92c0-e94a135ccc1d',NULL,NULL,NULL,NULL),('htmlformentry.showDateFormat','true','Set to true if you want static text for the date format to be displayed next to date widgets, else set to false.','1270ce7f-0cbc-490c-93c0-92acd75cd1a6',NULL,NULL,NULL,NULL),('htmlformentry.started','true','DO NOT MODIFY. true/false whether or not the htmlformentry module has been started.  This is used to make sure modules that were running  prior to a restart are started again','006ffb71-8865-45f0-88a2-328bc261c962',NULL,NULL,NULL,NULL),('htmlformentry19ext.mandatory','false','true/false whether or not the htmlformentry19ext module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','d9536ce1-a3e7-4c7d-803d-0c07ed627f51',NULL,NULL,NULL,NULL),('htmlformentry19ext.started','true','DO NOT MODIFY. true/false whether or not the htmlformentry19ext module has been started.  This is used to make sure modules that were running  prior to a restart are started again','40e0d24d-b275-4e90-8e8b-1b43a50ffcd1',NULL,NULL,NULL,NULL),('htmlformflowsheet.addAnotherButtonPosition','top','Lets you say where in the display to render the \'add another\' button.  Default is top.  Possible values:  top or bottom','22c16078-98ef-4fa6-9ee8-1e62db065980',NULL,NULL,NULL,NULL),('htmlformflowsheet.configuration',NULL,'flowsheets need these three items F (which stands for flowsheet) :Title:FormId\r\n        singletons need:           S:Title:FormId:Which         (where which is FIRST or LAST)\r\n        pipe delimited','563d56e4-2f60-4b0b-9b4c-c02cd28ad8b0',NULL,NULL,NULL,NULL),('htmlformflowsheet.drugDiscontinueReason',NULL,'The conceptId or UUID of the concept representing reasons for discontinuing a drug order.','bb018f0b-656d-4712-9d6d-5e5c90d8d07b',NULL,NULL,NULL,NULL),('htmlformflowsheet.encountersChronology','desc','Possible values here are desc and asc.  If not set, defaults to desc.','8a3d5969-69bf-4319-828b-9018e1172f48',NULL,NULL,NULL,NULL),('htmlformflowsheet.links',NULL,'links to appear at the top of the flowsheet.  Pipe delimited.  format is   name:link','14309698-ceed-458f-973b-3c6f112a9619',NULL,NULL,NULL,NULL),('htmlformflowsheet.mandatory','false','true/false whether or not the htmlformflowsheet module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','1472261c-7d33-4995-8f31-66c77d6b21b3',NULL,NULL,NULL,NULL),('htmlformflowsheet.patientChartFormIds',NULL,'Comma delimited formIds of all htmlforms that are the *parent* forms for patient charts.  Do not list\r\npatient chart sub forms in this list.  If you would like for links to be displayed, you can add entries\r\nof the following format:   formId:programId1|programId2,formId:programId1, programIds','d8b4b4e2-45af-4bbd-ae9b-45c817bab05e',NULL,NULL,NULL,NULL),('htmlformflowsheet.programConfigurationMap','{}','This property represents the EXACT javascript syntax for a map from programID to htmlformflowsheet url configuration.  \r\nFor example, {8:\"configuration=S:DDB:76:LAST,F:VISITS:77\",9:\"configuration=S:DDB:88:LAST,F:VISITS:89\"}\r\nmeans that there are two mapped programs -- program 8 and program 9.  For each of these programs, the url parameters to add are \r\ndefined in the values for each key.','9efc4481-3d7b-4c3c-a33d-23fa568d6817',NULL,NULL,NULL,NULL),('htmlformflowsheet.showMdrtbCatIVLink','false','adds the cat IV treatment card link to the form list in the mdrtb module.  valid values are blank, true, false','7234b5ce-9b0b-4e18-bed6-c229cfbf86b9',NULL,NULL,NULL,NULL),('htmlformflowsheet.started','false','DO NOT MODIFY. true/false whether or not the htmlformflowsheet module has been started.  This is used to make sure modules that were running  prior to a restart are started again','e34f6c80-9d56-4445-b51a-a81f4fa06c55',NULL,NULL,NULL,NULL),('htmlwidgets.mandatory','false','true/false whether or not the htmlwidgets module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','7a461f61-d40c-4e75-bbda-a6071c487b81',NULL,NULL,NULL,NULL),('htmlwidgets.started','true','DO NOT MODIFY. true/false whether or not the htmlwidgets module has been started.  This is used to make sure modules that were running  prior to a restart are started again','bed34213-5ba3-4155-b60d-f1c6fc2f63d1',NULL,NULL,NULL,NULL),('implementation_id','<implementationId id=\"1\" implementationId=\"tbr3khi\">\r\n   <passphrase id=\"2\"><![CDATA[Jb43Ics403]]></passphrase>\r\n   <description id=\"3\"><![CDATA[Open MRS Implementation for TB REACH 3 in Karachi]]></description>\r\n   <name id=\"4\"><![CDATA[TBR3/TB Xpert, Karachi]]></name>\r\n</implementationId>',NULL,'974126a3-e9ed-40e2-98a5-851ca9415fc1',NULL,NULL,NULL,NULL),('layout.address.format','<org.openmrs.layout.web.address.Addre