traindicationValue = getValue(\'regimen_contraindication.value\');\r\n				if (contraindicationValue == 1) {\r\n					regimenSerialDiv.hide();\r\n				}\r\n				else {\r\n					regimenSerialDiv.show();\r\n				}\r\n			});\r\n			$j(\"#regimen_contraindication\").change();\r\n		});\r\n	}\r\n	</script>\r\n</htmlform>',3,'2013-09-24 17:03:54',384,'2014-06-02 16:03:44',0,'c635a9b3-96ff-43a2-a448-8defe2e00944',NULL,NULL,NULL,NULL),(28,29,NULL,'<htmlform>\r\n	<br/>\r\n	<!-- Autogenerated example form  (template from 01-Nov-2010 -->\r\n	<macros>\r\n		paperFormId = (Fill this in)\r\n		headerColor =#009d8e\r\n		fontOnHeaderColor = white\r\n	</macros>\r\n	<style>\r\n		.section {\r\n			border: 1px solid $headerColor;\r\n			padding: 2px;\r\n			text-align: left;\r\n			margin-bottom: 1em;\r\n		}\r\n		.sectionHeader {\r\n			background-color: $headerColor;\r\n			color: $fontOnHeaderColor;\r\n			display: block;\r\n			padding: 2px;\r\n			font-weight: bold;\r\n		}\r\n		table.baseline-aligned td {\r\n			vertical-align: baseline;\r\n		}\r\n	</style>\r\n\r\n	<span style=\"float:right\">Paper Form ID: $paperFormId</span>\r\n	<h2>First Encounter Form for Diabetes (v1.0)</h2>\r\n	<section headerLabel=\"1. Encounter Details\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td>Form Date:</td>\r\n				<td>\r\n					<encounterDate default=\"today\"/>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Location:</td>\r\n				<td>\r\n					<encounterLocation default=\"1\"/>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Provider:</td>\r\n				<td>\r\n					<encounterProvider default=\"currentUser\" type=\"autocomplete\"/>\r\n				</td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n\r\n	<section headerLabel=\"2. Patient Information\">\r\n		<div>\r\n			<p>\r\n				Address: <lookup expression=\"patient.personAddress.address1\" />, <lookup expression=\"patient.personAddress.cityVillage\" />, <lookup expression=\"patient.personAddress.country\" />\r\n			</p>\r\n			<p>\r\n				Primary Mobile Number: <lookup expre