      <p>\r\n			<lookup expression=\"fn.getConcept(\'65\').description\"/><br/>\r\n			<obs conceptId=\"65\" id=\"voucher\" defaultValue=\"2\"/>\r\n		</p>\r\n                <div id=\"referralDiv\">\r\n                 <p>\r\n			<lookup expression=\"fn.getConcept(\'201\').description\"/><br/>\r\n			<obs conceptId=\"201\" id=\"voucher_type\" />\r\n		</p>\r\n                <p>\r\n			<lookup expression=\"fn.getConcept(\'156\').description\"/><br/>\r\n			<obs conceptId=\"156\" id=\"voucher_id\" size=\"14\"/>\r\n		</p>\r\n                </div>\r\n		</div>\r\n	</section>\r\n        <section headerLabel=\"5. Test Indication\">\r\n		<div id=\"tests\">\r\n			<p><lookup expression=\"fn.getConcept(\'68\').description\"/>:&#32;&#32;<span id=\"cxrVisible\">No</span></p>\r\n			<p><lookup expression=\"fn.getConcept(\'69\').description\"/>:&#32;&#32;<span id=\"gxpVisible\">No</span></p>\r\n			<p><lookup expression=\"fn.getConcept(\'70\').description\"/>:&#32;&#32;<span id=\"bgVisible\">No</span></p>\r\n			<p><lookup expression=\"fn.getConcept(\'72\').description\"/>:&#32;&#32;<span id=\"spVisible\">No</span></p>\r\n		</div>\r\n         <div id=\"hiddenTests\">\r\n           <p>\r\n			\r\n			<obs conceptId=\"68\" id=\"cxr\" defaultValue=\"2\"/>\r\n		</p>\r\n           <p>\r\n			<br/>\r\n			<obs conceptId=\"69\" id=\"gxp\" defaultValue=\"2\"/>\r\n		</p>\r\n            <p>\r\n			\r\n			<obs conceptId=\"70\" id=\"blood_glucose\" defaultValue=\"2\"/>\r\n		</p>\r\n            <p>\r\n			\r\n			<obs conceptId=\"72\" id=\"spirometry\" defaultValue=\"2\"/>\r\n		</p>\r\n         </div>\r\n         </section>\r\n	<submit/>\r\n\r\n	<script type=\"text/javascript\">\r\n		if(jQuery) {\r\n		$j(document).ready(function() {\r\n			$j(\"#measurements_taken\").change(function() {\r\n				var measurementsDiv = $j(\"#measurementsDiv\");\r\n				var measurementsTakenValue = getValue(\'measurements_taken.value\');\r\n				if (measurementsTakenValue == 1) {\r\n					measurementsDiv.show();\r\n				}\r\n				else